import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from '../Navbar/Navbar';
import Home from '../Home/Home';
import Faq from '../Faq/Faq';
import OurTeam from '../OurTeam/OurTeam';
import OTPVerification from '../OTPVerification/OTPVerification';
import MoneyTransfer from '../MoneyTransfer/MoneyTransfer';
import QRScanner from '../QRScanner/QRScanner';
import Footer from '../Footer/Footer';
import SplitExpenses from '../Splitwise/SplitExpenses';
import SplitWithFriends from '../Splitwise/SplitWithFriends'; // Import specific components
  // Add other split pages if needed

const Hero = () => {
  return (
    <Router>
      <div className="Hero">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/faq" element={<Faq />} />
          <Route path="/our-team" element={<OurTeam />} />
          <Route path="/verify-otp" element={<OTPVerification />} />
          <Route path="/money-transfer" element={<MoneyTransfer />} />
          <Route path="/split-expenses" element={<SplitExpenses />} />
          <Route path="/splitfriends" element={<SplitWithFriends />} />

          <Route path="/qr-scanner" element={<QRScanner />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
};

export default Hero;
